function DrawImage({ avatar = '',user_name='乔尼',rank = '1564',quality='0.5',file_type="image/png"},fn){
	const img_bg   = new Image()
	img_bg.src     = fs.readFileSync(path.join(__dirname, 'images', 'marker.png'))
	const canvas   = createCanvas(img_bg.width,img_bg.height);
	const ctx      = canvas.getContext('2d')
	const img_fill = new Image()
	img_fill.src   = avatar;
	// 绘制背景图片
	ctx.drawImage(img_bg, 0, 0, img_bg.width, img_bg.height);

	ctx.save(); // 记住当前的可画图区域
	ctx.arc(176,1027,125,0,Math.PI * 2,false); // 定义一个圆
	ctx.clip(); // 裁切，也就是定义可画图的区域，也就是上面的圆的范围，超出这个范围的部分不会被绘制
	ctx.drawImage(img_fill, 51, 902, 250, 250);
	ctx.restore(); // 恢复到上次记住的可画图区域

	// 绘制排名
	ctx.font = '180px bold 微软雅黑';
	ctx.lineWidth = 3
	ctx.fillStyle = '#870000'
	ctx.fillText(rank, 480, 1290);

	// 绘制姓名
	ctx.font = '60px bold 微软雅黑';
	ctx.lineWidth = 3;
	ctx.fillStyle = '#000';
	// 姓名可能长短不一，需要做逻辑判断
	ctx.fillText(user_name, 110, 1220);
	// 1429806
	canvas.createPNGStream().pipe(fs.createWriteStream(path.join(__dirname, 'image-src.png')))
	return canvas.toDataURL(file_type,quality,(err,result)=>{
		fn(err,result);
	});
}


